import React, { useState,useEffect } from 'react';

function ProductList() {
    const [products,setProducts]=useState([]);

    useEffect(()=>{
        getProduct();
    },[])

    const getProduct=async ()=>{
        let result=await fetch('http://localhost:5000/products');
        result=await result.json()
        setProducts(result);
    }

    const deleteProduct=()=>{
        console.warn();
    }
  

  return (
    <>
    <div className='product-list'>
        <h1>Product List</h1>
        <ul>
            <li><h4>Sl.No</h4></li>
            <li><h4>Name</h4></li>
            <li><h4>Price</h4></li>
            <li><h4>Category</h4></li>
            <li><h4>Company</h4></li>
            <li><h4>Operation</h4></li>
        </ul>
    {
        products.map((item,index)=>
        <ul key={index}>
            <li >{index+1}</li>
            <li >{item.name}</li>
            <li >{item.price} /-Rs</li>
            <li >{item.category}</li>
            <li >{item.company}</li>
            <li><button onClick={()=>deleteProduct}>Delete</button></li>
        </ul>

        )
    }
    </div>
    </>
  )
}

export default ProductList;
